Skills:
Overview
With a rich 40-year history in the areas of financial planning, education and investment services, Ayco develops and assists in implementing holistic financial solutions to help our clients achieve their goals. We believe in the power of human relationships to drive action, and a career with Ayco offers an opportunity to be part of this unique culture of client service. We invest in our associates, care about professional development, and believe in creating many paths of opportunity. Through our supportive, diverse and innovative environment, Ayco is committed to the success of our associates.

Responsibilities
Process daily postings of transactions and the reconciliation of client portfolios across various broker interfaces and proprietary systems;
Prepare monthly and quarterly client-facing reports and presentations for various business units;
Analyze data for periodic management reports;
Work on period-end reconciliations using scripts, macros, and advanced excel functions;
Provide support for integrated trading platform;
Act as a liaison with various financial institutions and third party vendors for client reporting;
Partner with the Technology Group and other business units on various projects.

Qualifications
Bachelor’s degree required, with concentration in Financial Services, Accounting, Information Management or a related field preferred;
Experience in information management, accounting, financial record keeping systems, database and spreadsheets is preferred. Advent experience is a plus;
Comprehensive understanding of the Financial Markets and securities;
Technology savvy and creative thinker;
Strong analytical and organizational skills;
Excellent judgment with a focus on client service;
Self-motivated with strong ability to problem solve;
Working knowledge of certain Microsoft products including Work, Excel, Windows, PowerPoint, and Outlook;
Superior written and verbal communication skills;
Excellent organizational skills;
Ability to multi-task.

