Data Trainee- Software Support- Technical Skills

~~Your day to day responsibilities:

*Collect, review, prepare, and import data for our processing system
*Test processed data for production releases
*Work with clients and data vendors to reconcile discrepancies
*Develop more efficient ways to manage our monthly data intake (automate processes)
*Document information and procedures related to our complex data intake and processing routines
*Opportunity to grow into more complex data analysis and some programming
You are someone who…
* Wants to learn and grow in technical skills working with data
*Loves data, wants to grow in skills to analyze and work with large sets of data;
*Enjoys data forensics (i.e. tracing how one record originates in our system, is modified, and eventually posts to our website);
*Is driven to create efficiency and automation in processes;
*Would choose efficiency and automation over repeating steps, and has the ability to quickly grasp technical concepts and explain them to non-technical people;
*Is willing to work full-time and on-site, with occasional overtime and weekend flexibility remotely via VPN.
Your experience and skills:

*1 to 2+ years of relevant work experience;
*4 year college degree (technical field a big plus);
*Experience working with Microsoft Office, including Excel. Any experience with databases and scripting languages like Python is a plus!
*Exceptional English skills, both written and verbal;
*Comfortable communicating with clients and vendors occasionally;
*Self-starter, takes ownership of issues, asks questions when the answer is unclear;
*Some serious excel chops.


Do you love working with data? Want to be part of a tight-knit team? Talisman is on the hunt for talented person to join our data team. We provide SAAS solutions for the insurance industry and are the leading provider of occupational health tools.

**Please note** This position is a ground floor opportunity to learn the ropes of data and programming, and develop technical skills. This position is NOT database administration or DBA, nor is it data analysis. Data Trainee provides legacy software support and will not be associated with cutting edge technology.


~~The Goodies:

*Competitive salary -- negotiable depending on experience and qualification;
*Paid medical, dental, long term disability, and life insurance for you (100% company paid);
*Paid medical and dental insurance for your dependents (100% company paid);
*Paid vacation, sick, paternity, and maternity leave;
*Paid holidays;
*Paid commuter benefit;
*401k plan with company matching and profit sharing;
*Relaxed, casual office environment;
*Great company culture;
*Friendly animals in the office!
More about us:

Talisman is an established tech company located in the Lower Haight/NOPA/Divisadero area of San Francisco. We're a small company with large fortune 500 clients. We provide SaaS solutions for the insurance industry and are the leading provider of occupational health tools. Find more about us at www.talispoint.com.
We will contact local candidates only, no assistance will be provided for travel or relocation and we are unable to sponsor H1B visa applicants. Principals only, no phone call please, EEO.


