Description Benefits Supplemental Questions

The Orange County Department of Social Services has openings for two Research and Data Analysts. Under general supervision, an employee in this class is primarily responsible for the collection and analysis of data relating to all Department of Social Services programs.

One of the analysts will facilitate collaboration between five human service departments (Social Services; Public Health; Aging; Child Support Services; and Housing, Human Rights and Community Development) by performing cross-departmental data collection and analysis, including written and oral presentations. Research topics will include issues that affect human service clients such as housing, food access, poverty, and transportation.

The employees provide technical expertise in analyzing data, and perform research and analysis in support of the department's programs and other programs shared among other County departments. An employee of this class is responsible for performing various activities concerned with planning and research studies. These include the collection of data, the analysis, evaluation, interpretation and reporting of current and/or proposed operating programs as well as policies and legislation related to such programs for the purpose of evaluating actual and potential effectiveness in achieving objectives, and for providing advice and consultation to management and administrative personnel. The employees will be required to apply statistical techniques and data analysis in order to develop or modify program objectives and operations, requiring knowledge of research methodology and program operations. Employees in this class will be required to demonstrate independent judgment within the guidelines of established local government procedures, local ordinances and North Carolina General Statutes governing the responsibilities of local government operations. Does related work as required.

Examples of Duties:Examples of Essential Functions: Following are examples of typical work activities and responsibilities. The incumbent may be responsible for performing other related duties and responsibilities as required or assigned. A position may not include all the work examples given, nor does the list include all that may be assigned.

Provides advice and consultation to program and departmental administrators, managers on such matters as the improvement of program effectiveness, the interpretation of study findings relevant to the program, and implications of policy or legislative changes on affected programs, and the most effective alternative in terms of direct benefit to such programs;

Design research projects, collect and analyze qualitative and quantitative data, and share results of analysis.

Selects the appropriate methods to follow in validating, analyzing and evaluating data considering the character and sources of data and the statistical tools to be used;

Collects data using departmental statistics and records, on-site investigations, discussions with operating personnel, and other sources;

Conducts evaluative analysis of a variety of program areas including policy, procedure, objectives, cost effectiveness, staff utilization, etc.;

Identifies actual or potential problem areas, trends, program accomplishments and related factors;

Monitors and measures the progress toward program goals and determines the soundness of program objectives;

Identifies new program needs considering overall departmental goals, community or population needs, and other relevant conditions and trends;

Develops and recommends program objectives, policies and procedures to improve program effectiveness;

Prepares forecasts of factors that may directly affect program operations for use in program planning activities;

Prepares and/or supplies necessary information for mandated reports or in response to requests for information;

Presents results of studies or investigations to management and operating officials, covering conclusions and recommendations based on the analysis and evaluations.

One of the analysts will be responsible for coordinating and facilitating regular meetings on data collaboration with analysts from the five human service departments in order to establish a cross-departmental data-driven culture as well as coordinating and facilitating regular meetings on shared challenges with the five human service department directors.

Typical Qualifications:REQUIRED KNOWLEDGE, SKILLS, ABILITIES AND ATTRIBUTES:
Knowledge of the principles and techniques of conducting research utilizing statistical and costing methods;
Knowledge of the principles of public administration; good knowledge of data collection techniques; familiarity with modern electronic data processing techniques and the capability of data processing equipment;
Familiarity with the subject department program operations, goals, and objectives; familiarity with appropriate laws, rules, regulations and procedures governing the operation of the subject department and its programs;
Skill in analyzing data, problem solving, decision making, and report writing.
Ability to design effective questionnaires, reporting procedures, and statistical tables;
Ability to convey specific factual and analytical information in both oral and written reports;
Ability to organize and analyze data;
Ability to establish and maintain effective working relationships with others;
Ability to plan and carry out program studies;
Ability to effectively use computer applications such as spreadsheets, word processing, calendar, email and database software in performing work assignments;
Initiative; creativity; resourcefulness; thoroughness; dependability; good judgment; physical condition commensurate with the demands of the position.
MINIMUM ACCEPTABLE TRAINING AND EXPERIENCE:

Requires a Bachelor's degree in business, public administration, finance or a related field, and two years of experience involving statistical research in program areas which include experience in data analysis, strategic planning, program / policy evaluation, management, preferably in local government knowledge or any equivalent combination of education, training, and experience, which provides the required knowledge, skills, and abilities.

Requires strong written and oral communication skills for presenting information.

Requires the ability to effectively coordinate groups at various levels of leadership across county departments.

Prefer applicant with a Master's Degree in a human services or public administration field.

Supplemental Information:PHYSICAL REQUIREMENTS

Must be able to perform the basic life operational support functions of seeing, hearing, reaching, pulling, lifting, fingering, grasping, talking and repetitive motions of the wrists/hands/fingers.

Work is sedentary and may require exerting up to 10 pounds of force occasionally.

Worker is subjected to long periods of sitting.

Must have close visual acuity to perform extensive reading, operate and computer terminal and perform mathematical calculations.

Worker is subjected to inside environmental conditions.

Worker is not typically subjected to adverse environmental conditions.

